impl Solution {
    pub fn count_interesting_subarrays(nums: Vec<i32>, modulo: i32, k: i32) -> i64 {
        let mut count = 0i64;
        let mut prefix_sum = vec![0; nums.len() + 1];
        let mut frequency = std::collections::HashMap::new();
        frequency.insert((0, 0), 1i64);

        for i in 0..nums.len() {
            let current_mod = if nums[i] % modulo == k { 1 } else { 0 };
            prefix_sum[i + 1] = (prefix_sum[i] + current_mod) % modulo;
            let key = (prefix_sum[i + 1], (prefix_sum[i + 1] + modulo - k) % modulo);
            count += *frequency.get(&key).unwrap_or(&0);
            *frequency.entry(key).or_insert(0) += 1;
        }

        count
    }
}
